import Headerimg from '../assets/img/header-img.jpg' 

function Header(){
    return (
        <section id="header">
        <img id="header-image" src="assets\img\header-img.jpg" />
        <div id="header-content">
            <h1>Antoine DESPRES</h1>
            <h2>étudiant en 2ème année <br/>Informatique Web / Logiciel</h2>
        </div>
        </section>
    )
}

export default Header
